import {connect} from "react-redux";

class FitnessClass extends React.Component {

	render() {
		return (
			<div className="classTile">
				<h2>{this.props.name}</h2>
			</div>
			)
	}

} 

export default connect(null, mapDispatchToProps)(FitnessClass)
